// utils/sendConversionData.js
export const sendConversionData = () => {
  const campaignName = localStorage.getItem("campaign_name");
  const campaignId = localStorage.getItem("campaign_id");

  if (typeof MediaAlphaExchange !== "undefined") {
    MediaAlphaExchange.conversion({
      campaign_name: campaignName,
      campaign_id: campaignId,
      // Add any additional conversion data here
    });
  }
};
